def my_func(input1: str):
    if not (1 <= len(input1) <= 20):
        return None

    words = input1.split()
    result_words = []

    for word in words:
        parts = word.split('-')
        capitalized_word = parts[0] + ''.join(part.capitalize() for part in parts[1:])
        result_words.append(capitalized_word)

    return ' '.join(result_words)
